                "SellersItemDescription": {
                    "ShortDescription": "RIPROCK 24 SIL/MXORG/BLK 11",
                    "LongDescription": "Dirt, street, trails—the all-new Riprock 24 doesn&#39;t fit neatly into any one box. \r\nIt&#39;s purpose-built for fun, no matter how your little tike decides to ride it.\r\n\r\nWith a pair of our ultra-wide, 2.8-inch tires and comfortable, confident \r\ngeometry, smiles are going to be guaranteed. That&#39;s because the big tires and \r\n24-inch wheels provide heaps of traction, control, and confidence over any \r\nterrain, while a bump-eating, coil-sprung suspension fork will make quick work of \r\nabsorbing any rough stuff. \r\n\r\nThrow in a set of powerful, low maintenance mechanical disc brakes and a \r\nlow standover that makes getting the perfect fit a total breeze, and you have \r\nyourself a bike that&#39;s going to make any kid want to rip and rock around the \r\nneighborhood till the sun goes down."
